import React from 'react';

const fetchEvolution = async function () {
    const resp = await fetch('https://pokeapi.co/api/v2/evolution-chain/3/');
    const data = await resp.json();
    return data;
}

const ApiTest = () => {
    return (
        <div>
                {
                    fetchEvolution.map(item =>
                        <p>{item}</p>
                    )
                }
        </div>
    );
}

export default ApiTest;
